We provide a method to know when there is nothing left to read: pub fn is_empty(&self) -> bool { return self.chars.as_str().len() == 0;
} We mentioned above that the struct field initial_len would be used to determine the length of a token. The idea is that we can determine, using methods from Chars, the length remaining in the iterator. By subtracting this from initial_len we can find out how much we have read. If we reset initial_len every time we read a token, we can determine the length of a token. To get the length: pub fn len_consumed(&self) -> usize { return self.initial_len - self.chars.as_str().len();
} To reset initial_len: pub fn reset_len_consumed(&mut self) { self.initial_len = self.chars.as_str().len();
}

