We first provide a basic function to advance just one character, which is essentially a wrapper around Char.next() that updates the other fields appropriately. Maybe this function will be called, but it will be particularly useful as a building block. pub fn adv(&mut self) -> Option<char> { let consumed_char = self.chars.next()?; self.prev = consumed_char; return Some(consumed_char);
} Notice the ? propogates a return value of None from Chars.next() to the caller of adv(), so that a value of None is returned from adv() when there are no more characters left in the iterator. If we're thinking about using this to consume tokens, then you can imagine we will be advancing until we reach the end of a token. We don't want to have to consume a character belonging to the next token just to know when the current one has ended. We want a function that will allow us to "look ahead" without consuming the next character. pub fn peek(&self) -> char { let c: char; match self.chars.clone().next() { Some(ch) => { c = ch; } None => { c = EOF_CHAR; } } return c;
} Note that this is not very efficient, as it involves making a copy of the iterator and then consuming the next character in the copy. "Peeking" functions are generally not efficient, as iterator data structures do not prioritize the efficiency of this functionality. Why do we return end-of-file here and none above? We are almost ready to write the "advance until" function. The last business to deal with is figuring out how to let the caller of this function specify the "stop" condition. One option would be to let the user pass in a char as a parameter, so that we stop advancing right before that char is consumed. To leave room for more complex conditions, however, we let the user pass in a function that takes in a char and returns a bool. The bool will tell us to stop advancing if it is false. pub fn adv_until(&mut self, mut condition: impl FnMut(char) -> bool) { while condition(self.peek()) && !self.is_empty() { self.adv(); }
} As we've just discussed, condition is the function telling us when to stop advancing. Why mutable function instead of regular function? We'll also stop advancing if there is nothing left to read.
